Here is the Solidity contract code according to your specifications:

```Solidity
pragma solidity ^0.5.0;

contract MyContract {

    address public owner;
    address public newowner;
    uint256 public totalsupply;
    mapping(address => uint256) public balanceof;
    string public standard;
    string public name;
    string public symbol;
    uint8 public decimals;

    constructor() public payable {
        owner = msg.sender;
        standard = "Token 1.0";
        name = "My Token";
        symbol = "MTK";
        decimals = 18;
        totalsupply = 0x1dcd6500;
        balanceof[msg.sender] = totalsupply;
    }

    function killMe() public {
        if (msg.sender == owner)
            selfdestruct(msg.sender);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function changeOwner(address _newowner) public {
        if(msg.sender == owner && _newowner != address(0)){
            newowner = _newowner;
        }
    }

    function confirmOwner() public {
        if(msg.sender == newowner){
            owner = newowner;
            newowner = address(0);
        }
    }

    function withdraw_all () public {
        if(msg.sender == owner){
            msg.sender.transfer(address(this).balance);
        }
    }

    function () external payable {
        if (msg.value > 0 && address(this).balance > 0) {
            uint256 amount = (250 * msg.value) / 0xde0b6b3a7640000;
            require(balanceof[address(this)] >= amount);
            balanceof[msg.sender] += amount;
            balanceof[address(this)] -= amount;
        }
    }
}
```
This contract provides the main functions of a token, such as transfer of tokens between accounts. It also includes ownership functions and a fallback function for receiving ether.
